//img.shields.io/npm/v/biz-auto-form.svg)](https://www.npmjs.com/package/biz-auto-form)\n\n[![NPM](https://nodei.co/npm/biz-auto-form.png)](https://nodei.co/npm/biz-auto-form/)\n\n## 介绍\n- 本组件源于快速配置制作广告样式物料表单，但不乏一般适用性。\n- 本组件基于React开发，其中包括表单中常用的一些输入控件controls 和字段组fieldsets 可供使用。\n- 表单数据以`json对象`组织，可自动回填数据。\n- 可根据 `json对象数组` 自动渲染生成表单，表单中包含校验，并支持一些特殊的动态输入形式。\n- 系统无关性，在多个系统中引用本组件，使用一份`json对象数组`配置，可以渲染得到同样的表单。可做到一处配置，处处所见。\n- 当`输入控件Controls` 和 `字段组Fieldsets` 不满足需求时，可以插件形式扩展。\n\n\n## 安装\n```\nnpm install biz-auto-form\n```\n或\n```\nnpm install @bizfe/biz-auto-form\n```\n\n## 使用示例\n```\nimport AutoForm from \'biz-auto-form\';\nimport formDesc from \'./108.json\';\n\nReactDom.render(\n    <AutoForm\n        data={dataObj}\n        onSubmit={(values) => {\n          console.log(values);\n        }}\n        descriptor={formDesc}\n    />,\n    this.el\n);\n```\n引入样式：\n```\nimport \'biz-auto-form/assets/index.css\';\n```\n\n引入组件中的输入控件\n```\nimport { Controls } from \'biz-auto-form\';\nconst Input = Controls.Input;\n```\n\n引入组件中的字段组\n```\nimport { Fieldsets } from \'biz-auto-form\';\nconst ListFieldset = Fieldsets.ListFieldset;\n```\n\n也可以全局引用构建后的文件，[Try it on CodePen](https://codepen.io/CharmSun/pen/ZJVNMa)\n```\n<link rel="stylesheet" type="text/css" href="//unpkg.com/biz-auto-form@1.2.6/dist/biz-auto-form.min.css">\n<script src="//unpkg.com/react/umd/react.production.min.js"><\/script>\n<script src="//unpkg.com/react-dom/umd/react-dom.production.min.js"><\/script>\n<script src="//unpkg.com/biz-auto-form@1.2.6/dist/biz-auto-form.min.js"><\/script>\n```\n\n## 设计方案\n![image](./images/auto-form.png)\n\nAutoForm组件通过data属性`（json对象）`可以回填表单数据json对象，\n通过descriptor属性`（json对象的数组，每一项对应一个字段）`自动渲染生成整个表单，\ndescriptor 的json数组中每一项json对象基本与字段FormField和输入控件的props属性对应上，每一项渲染对应的FormField 和Fieldsets组件。\n\n所有单个表单字段全部抽象为FormField组件，包括字段名，附加说明，值，默认值，值的校验等，\nFormField组件的子组件为Controls中的输入控件，输入的值通过onChange事件传递值至FormField组件。\n\nForm表单中还会有字段组Fieldsets，这类组件是多个字段的组合，字段组中包含的多个字段可以按输入需求变化，最后字段组的值会按字段组的name收集。\nFieldsets组件以FormField为基础，也可以嵌套Fieldsets组件。\n\nControls中的组件和Fieldsets中的组件，是可以扩展的，以满足更多的表单输入需求。\n扩展开发的Controls 组件和Fieldsets 组件，添加至 Controls 和 Fieldsets 中即可用于自动生成。\n\n## 目录结构\n```\nassets        //各组件样式\n├── styles\n└── index.less\nexamples     //示例及文档\nsrc          //源码\n├── common      \n    ├── \n├── controls   //各输入控件\n    ├── \n├── fieldsets  //各形式字段组\n    ├── \n├── AutoForm.jsx\n├── FieldConverter.jsx\n├── Form.jsx\n├── FormField.jsx\n└── index.jsx\ntest          //单元测试\n```\n\n## Test Case\n```\nnpm test\n```\n\n## 生成文档和示例\n```\nnpm run doc\n```\n\n'},function(e,t,n){"use strict";function r(e){return e&&e.__esModule?e:{default:e}}Object.defineProperty(t,"__esModule",{value:!0});var a=n(7),o=r(a),i=n(2),s=r(i),l=n(6),u=r(l),c=n(3),d=r(c),f=n(4),p=r(f),m=n(0),h=r(m),_=n(346),y=r(_),v=n(513),b=r(v),g=n(514),M=r(g),k=n(515),w=r(k),L=n(16),x=r(L),T=n(516),Y=r(T),S=function(e){function t(e){return(0,s.default)(this,t),(0,d.default)(this,(t.__proto__||(0,o.default)(t)).call(this,e))}return(0,p.default)(t,e),(0,u.default)(t,[{key:"render",value:function(){return h.default.createElement("div",null,h.default.createElement("h1",null,"Input、TextArea 等输入框"),h.default.createElement("h4",null,"Input示例："),h.default.createElement(y.default,null),h.default.createElement("h4",null,"TextArea示例："),h.default.createElement(b.default,null),h.default.createElement("h4",null,"插入标红词："),h.default.createElement(M.default,null),h.default.createElement("h4",null,"插入链接词："),h.default.createElement(w.default,null),h.default.createElement(x.default,{text:Y.default}))}}]),t}(h.default.Component);t.default=S},function(e,t,n){"use strict";function r(e){return e&&e.__esModule?e:{default:e}}Object.defineProperty(t,"__esModule",{value:!0});var a=n(7),o=r(a),i=n(2),s=r(i),l=n(6),u=r(l),c=n(3),d=r(c),f=n(4),p=r(f),m=n(0),h=r(m),_=n(13),y=_.Controls.Input,v=function(e){function t(e){(0,s.default)(this,t);var n=(0,d.default)(this,(t.__proto__||(0,o.default)(t)).call(this,e));return n.handleChange=functi